import React, { useState } from 'react';
import ReactApexChart from 'react-apexcharts';

const generateData = (base: number, count: number, options: { min: number; max: number }) => {
  const data = [];
  for (let i = 0; i < count; i++) {
    data.push([base + i * 30000000, Math.floor(Math.random() * (options.max - options.min + 1)) + options.min, Math.floor(Math.random() * (options.max - options.min + 1)) + options.min]);
  }
  return data;
};

const AbnormalDetectionChart: React.FC = () => {
  const [state, setState] = useState({
    series: [{
      name: 'Bubble1',
      data: [[1, 0.0, 1],
      [2, 36.25, 508],
      [3, 45.0, 587],
      [4, 52.25, 0],
      [5, 42.0, 0],
      [6, 34.15, 583],
      [7, 46.6, 583],
      [8, 46.25, 584],
      [9, 38.9, 583],
      [10, 39.55, 584]]
    },
    {
      name: 'Bubble2',
      data: [[1, 0.0, 1],
      [2, 48.8, 0],
      [3, 20.45, 587],
      [4, 20.05, 583],
      [5, 20.4, 584],
      [6, 13.65, 583],
      [7, 20.0, 583],
      [8, 20.45, 584],
      [9, 13.4, 583],
      [10, 13.5, 584]]
    },
    {
      name: 'Bubble3',
      data: [[1, 0.0, 1],
      [2, 34.55, 508],
      [3, 51.7, 0],
      [4, 31.7, 583],
      [5, 32.25, 584],
      [6, 55.65, 0],
      [7, 53.75, 0],
      [8, 43.3, 0],
      [9, 23.25, 583],
      [10, 21.85, 584]]
    },
    {
      name: 'Bubble4',
      data: generateData(new Date('11 Feb 2017 GMT').getTime(), 20, {
        min: 10,
        max: 60
      })
    }],
    options: {
      chart: {
          height: 350,
          type: 'bubble' as const,
      },
      dataLabels: {
          enabled: false
      },
      fill: {
          opacity: 0.8
      },
      title: {
          text: ''
      },
      xaxis: {
          tickAmount: 12,
          type: 'category' as const,
      },
      yaxis: {
          max: 70
      }
    },
  });

  return <ReactApexChart options={state.options} series={state.series} type="bubble" height={350} />;
};

export default AbnormalDetectionChart;
